import React,{Component, useState} from 'react'
import Logo from "../Images/etsylogo.png";
import { BrowserRouter as Router, Link, Route, Routes} from "react-router-dom";
import ReatDom  from 'react-dom';
import SearchIcon from "@material-ui/icons/Search";
import FavoriteBorderIcon from "@material-ui/icons/FavoriteBorder";
import {Col, Row} from 'react-bootstrap';
import "../css/Navigationbar.css";
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import { useStateValue } from '../StateProvider';
import PermIdentityIcon from '@material-ui/icons/PermIdentity';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import {useNavigate} from 'react-router';
import { useDispatch } from "react-redux";
import { logout } from '../features/userSlice';
function Navigationbar() {
  let navigate=useNavigate();

  const [anchorEl, setAnchorEl] = React.useState(null);
  const [SearchTerms,setSearchTerms] = useState("");
  const onChangeSearch=(e) =>{
    setSearchTerms(e.currentTarget.value)

  }
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);}
  const handleClose = () => {
    setAnchorEl(null);
  };
  const handleLogout=(e)=>{
    e.preventDefault();
    const dispatch=useDispatch();
    dispatch(logout)
  }

  return (
    <div>
        <nav className="header">
           <Link to="/Home">


              <img className="header_logo" src={Logo} alt="logo"/>
            </Link>

            <div  className='header-search'>
                <input type="text" className='header_searchinput' placeholder='Search anything'></input>
                <Link to="/SearchItem">
                  <SearchIcon  value={SearchTerms} className="header_searchicon" onChange={onChangeSearch}></SearchIcon>
                </Link>
            </div>

            <Link to="/Favorites">
                <FavoriteBorderIcon className='fav_icon'></FavoriteBorderIcon>

            </Link>
            <div>
              <PermIdentityIcon
                  id="basic-button"
                  aria-controls={open ? 'basic-menu' : undefined}
                  aria-haspopup="true"
                  aria-expanded={open ? 'true' : undefined}
                  onClick={handleClick}> 

              </PermIdentityIcon>
            <Menu
              id="basic-menu"
              anchorEl={anchorEl}
              open={open}
              onClose={handleClose}
              MenuListProps={{
              'aria-labelledby': 'basic-button',
            }}
            >
              <MenuItem onClick="/Profile">Profile</MenuItem>
              <MenuItem onClick="/Orders">Orders</MenuItem>
              <Link to="/SellOnEtsy">
              <MenuItem >Sell on Etsy </MenuItem></Link>
              <MenuItem onClick={(e)=>handleLogout(e)}>Logout</MenuItem>

            </Menu>
          </div>


            <Link to="/cart">
              <ShoppingCartIcon className="shopping_icon"></ShoppingCartIcon>

            </Link>








        </nav>
      </div>

  )
}


export default Navigationbar
